import React from 'react';
import styled from 'styled-components';
import CelestiaLogo from '../assets/CelestiaLogo.svg';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faAngleUp, faAngleDown} from '@fortawesome/free-solid-svg-icons';

const Container = styled.header`
    display: flex; 
    padding: 1em;
    align-items: center;
    justify-content: space-between;
`

const Logo = styled.img`

`

const Navigation = styled.nav`

`

const List = styled.ul`
    list-style: none;
    display: flex;
`

function Heading() {
  return (
    <Container>
        <Logo src={CelestiaLogo} alt='Celestia Logo'/>
        <Navigation>
            <List>
                <li>Learn <FontAwesomeIcon icon={faAngleUp}/></li>
                <li>Build <FontAwesomeIcon icon={faAngleDown}/></li>
                <li>Community <FontAwesomeIcon icon={faAngleDown}/></li>
            </List>
        </Navigation>
    </Container>
  )
}

export default Heading
